// react
import React, { Component } from 'react';

// third-party
import PropTypes from 'prop-types';
import { Helmet } from 'react-helmet';
import { Link, Redirect, Route, Switch } from 'react-router-dom';

// application
import QuickSearch from './QuickSearch';
import SearchMenu from './SearchMenu';
import Breadcrumb from '../../shared/Breadcrumb';

// pages
import { SearchCriterias } from './search-criterias/index';
import { SearchCustom } from './search-custom/index';
import { SearchGeneral } from './search-general/index';
import { SeachGenericArticle } from './search-generic-article/index';
import { SearchManufacturer } from './search-manufacturer/index';
import { SearchTyre } from './search-tyre/index';
import { SearchUniversal } from './search-universal/index';
import { SearchVehicles } from './search-vehicles/index';

export class Search extends Component {
    render() {
        return (
            <div className="ekat-search">
                <div className="ekat-search__quick-search">
                    <QuickSearch />
                </div>
                <div className="ekat-search__search-menu">
                    <SearchMenu />
                </div>

                <div className="ekat-search__body">
                    <Switch>
                        <Route exact path="/search-criterias" component={SearchCriterias} />
                        <Route exact path="/search-custom" component={SearchCustom} />
                    </Switch>
                </div>
            </div>
        );
    }
}
